import React, { useState, useEffect } from 'react';
import NewCalendarCell from './NewCalendarCell';

const NewCalendar = () => {

    const [days] = useState(['일', '월', '화', '수', '목', '금', '토']);
    const [dates, setDates] = useState([]); // 달력의 행


    return (
        <div id="monthly-view">
            <div className="day-row">
                {days.map((a, i) => (
                    <div key={i} className="day-cell">
                        {a}
                    </div>
                ))}
            </div>

            {dates.map((a, i) => (
                <div key={i} className="monthly-row">
                    {a.map((b, j) => <NewCalendarCell key={j} date={b} schedule={getCurDateSchedule(b)} />)}
                </div>
            ))}
        </div>
    );
};

export default NewCalendar;
